// Solution for: https://leetcode.com/problems/n-repeated-element-in-size-2n-array/
const repeatedNTimes = (nums) => {
    const occurrences = new Map();
    for (let num of nums) {
        occurrences.set(num, (occurrences.get(num) + 1) || 1);
    }
    let mostFrequentValue = 0;
    let mostFrequentKey = 0;
    const entries = occurrences.entries();
    let entry = {};
    while (entry) {
        entry = entries.next().value;
        if (!entry)
            continue;
        if (entry[1] > mostFrequentValue) {
            mostFrequentValue = entry[1];
            mostFrequentKey = entry[0];
        }
    }
    return mostFrequentKey;
};
